:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Samuel and WILLIAMS, Mary
  JWILLIAMS, Lucy Frances and WARREN, Thomas John Cory (Jack)
  JWARREN, Mary Williams and McBAIN, Hubert
  WARREN, Mary Williams and McBAIN, Hubert (cont...)
  Mary attended Sherbourne School for Girls, Dorset, England then Chilton House School in Wellington. She
  attended Heatherley Art School in London for a time following WW1.
  01> McBAIN, John Hubert m on 23.04.1960 to CURTIS, Ann Constable
  b 15.10.1936
  b 26.01.1937
  John m. at Winston, Co Durham, England. Ann, d/o Captain F M Curtis. Address: Westholme, Winston, Nr
  Darlington, County Durham, England.
  John was educated at Wellington College, Berkshire, and Sandhurst and served in the Durham Light
  Infantry from 1956 to 1966. He then took up farming at Westholme Hall, Winston. He was High Sheriff of
  Durham (1990-91).
  01> McBAIN, Rupert John Maynard m on 28.09.1990 to CAREY, Georgina DeLisle
  b 10.01.1965
  b ** ** ****
  01> McBAIN, Harriet Georgina Snowdrop
  b 08.02.1991
  02> McBAIN, William Hugh
  b 06.02.1968
  02> McBAIN, James
  b 16.12.1938 d 18.10.1965
  James was educated at Red House School (nr York), Marlborough College and St John's College, Durham.
  03> McBAIN, Hugh m on 26.01.1974 to THRUPP, Deirdre Ellene Margaret Victoria
  b 10.10.1945
  b 11.11.1947
  Hugh b. at Newcastle-on-Tyne, England and m. at Templepatrick, Northern Ireland. Victoria, d/o HE PF
  Thrupp and EF Anderson. Address: Langton House, RD 1, Otane, Hawkes Bay.
  Hugh was educated at Red House School, York and Wellington College, Berkshire. In 1964 he went to the
  Royal Military Academy, Sandhurst, and was commissioned in 1965. He joined the Durham Light Infantry
  and was stationed in England, in Cyprus with the United Nations Peace Keeping Force and in Northern
  Ireland. After resigning from the Army in 1969 he came to New Zealand and attended Lincoln College
  (1972-73) before taking over the family farm, "Kahotea", at Te Aute, Hugh has been a trustee of the
  Henry and William Williams Memorial Trust since 1975.
  Vickie attended Belfast College of Domestic Science and gained a Diploma in Institutional Management,
  She and Hugh moved to Langton House, Pukehou, in 1995.
  01> McBAIN, Simon James Thrupp
  b 23.07.1975 d 26.05.1976
  Simon bd. at Pukehou.
  02> McBAIN, Richard James Thrupp
  b 14.03.1978
  Richard was educated at Pukehou School, Hereworth School and Wanganui Collegiate School where he
  was in the 1st rugby XV and the rowing VIII. He competed with the New Zealand Under-19 rowing VIII
  in 1995 and 1996. He is currently at Lincoln University.
  03> McBAIN, Caroline Mary
  b 08.01.1980
  Caroline was educated at Pukehou School, Woodford House and Wanganui Collegiate School where she
  was in the girls' rowing VIII. She is currently on a tutorship at Wellington College, Berkshire,
  England.
